import { useState } from "react";
import "./index.css";

export default function Modal(props) {

  // const [open, setOpen] = useState(false)

  return (
    <div className="maxLayout" style={
      {

      }
    }>
      <div className="modalLayout">
        <h1>Novo Veículo</h1>

        <form action="#" method="get">
          <div className="rowOne">
            <div className="column">
              <div className="label-input">
                {/* <label htmlFor="veiculo">Veículo</label> */}
                <input type="text" id="veiculo" placeholder="Veículo" />
              </div>

              <div className="label-input">
                {/* <label htmlFor="ano">Ano</label> */}
                <input type="text" id="ano" placeholder="Ano" />
              </div>
            </div>

            <div className="column">
              <div className="label-input">
                {/* <label htmlFor="marca">Marca</label> */}
                <input type="text" id="marca" placeholder="Marca" />
              </div>

              <div class="toggle">
                <input type="checkbox" id="vendido" />
                <label htmlFor="vendido"  id="vendidoLabel" ></label>
                <label htmlFor="vendido">
                  Vendido
                </label>
              </div>
            </div>
          </div>

          <div className="label-input">
            <label htmlFor="descricao">Descrição</label>
            <textarea id="descricao"></textarea>
          </div>

          <div className="buttons">
            <button type="submit">ADD</button>
            <button id="sair">FECHAR</button>
          </div>
        </form>
      </div>
    </div>
  );
}
